Item.method_code:
var fromDate = document.forms[0].from_date.value;
var toDate = document.forms[0].to_date.value;

if(new Date(toDate) < new Date(fromDate))
{
    return alert("To Date must be greater then from date");
}
else
{
    var retVal = [];
    retVal.runReport="1";
    retVal.to_date = toDate;
    retVal.from_date = fromDate;

    parent.dialogArguments.dialog.close(retVal);
}
